import axios from 'axios';
import { ADD_DIARY } from './types';


export const addDiary = (diary) => {
    return (dispatch, getState) => {
        axios
        .post("api/diary/diaries/new", diary)
        .then(res => {
            dispatch({
                type: ADD_DIARY,
                payload: res.data
            })

        })
        .catch(error => {
            console.log(error.response)
        })
    }
}
